import React from 'react';
import { Cover } from '../components/Cover';
import { Listen } from '../components/Listen';

export const HomePage = () => {
    return (
        <section id='home'>
            <a href='https://ffm.to/chazzy' target='_blank'>
                <div id='listen'>Listen</div>
            </a>
            <Cover />
        </section>
    );
};
